import React, { useState } from 'react';
import { Container, Row, Col, Button, Card, CardBody, CardTitle, Modal, ModalHeader, ModalBody, ModalFooter, Media, Table } from "reactstrap";

// Pages Components
// import LatestTranaction from "./LatestTranaction";
import LibraryList from "./LibraryList";


//Import Breadcrumb
import Breadcrumbs from "../../../components/Common/Breadcrumb";

//i18n
import { withNamespaces } from 'react-i18next';

 const Library = (props) => {


          return (
              <React.Fragment>
                <div className="page-content">
                    <Container fluid>

                        {/* Render Breadcrumb */}
                        <Breadcrumbs title={props.t('Library')} breadcrumbItem={props.t('Library')} />

                        <Row>
                            <Col lg="12">
                                <LibraryList/>
                            </Col>
                        </Row>
                    </Container>
                </div>
            </React.Fragment>
          );
        }

export default withNamespaces()(Library);
